import React, { useState } from 'react';

function Login() {
  const [login, setLogin] = useState('login');
  const changeFormHandler = () => {
    login === activeForm ? 'active_btn_log' : '';
  };

  return (
    <main className="container m-auto">
      <section class="flex justify-center items-center mt-16">
        <form action="" class="flex-col flex space-y-6 w-[250px] form py-8 px-4">
          <div class="flex justify-center">
            <h2 class="hover:text-gray-400 cursor-pointer active_btn_log">Login</h2>/
            <h2 class={`hover:text-gray-400 cursor-pointer`}>Register</h2>
          </div>

          <input
            class="py-2 px-3 w-full border rounded-2xl bg-[#f2f2f2]"
            type="text"
            placeholder="Login"
          />
          <input
            class="py-2 px-3 w-full border rounded-2xl bg-[#f2f2f2]"
            type="text"
            placeholder="Login"
          />

          <button type="submit" class="btn_log">
            Send
          </button>
        </form>
      </section>
    </main>
  );
}

export default Login;
